import React from 'react';
import { GoogleMap } from 'react-google-maps';

function Map() {
    return(
        <div>
            <GoogleMap defaultZoom={10} defaultCenter={{lat: 12, lng: 12}}/>
        </div>
    )
}

export default function Maps() {
    return (
        <div style={{color: 'white'}}>
            map here
        </div>
    )
}
